import React from "react";
import "./app-header.css"
const AppHeader = () =>{

    return(
        <div >
            <div >
                <div className="app-header d-flex">
                    <h1>My Todo List</h1>
                    <h6>1 more to do, 3 done</h6>
                </div>

            </div>


        </div>


    )
}

export default AppHeader;
